import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from '@mui/material';
import Connect from './Connect';
import Login from './Login'; // Asigură-te că ai definit și importat componenta Login

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Connect} />
        <Route exact path="/login" component={Login} />
      </Switch>
    </Router>
  );
}

export default App;
